import React, { Component } from "react";
import Cards from "./Cards";
import "./CardList.css";

class CardList extends Component {
  render() {
    const { data } = this.props;

    return (
      <div className="main">
        {data.map()}
        <Cards name={data.cards[0].title} />
        <Cards />
        <Cards />
      </div>
    );
  }
}

export default CardList;
